import './App.css';
import React, { Component } from 'react'
import axios from 'axios'


class App extends Component {
    constructor(props) {
	super(props);
	this.state = {
	    preset: this.getPreset()
	}
    }
    componentDidMount(){
	this.getPreset();
    }

    getPreset() {
	axios
	    .get('http://127.0.0.1:8000/api/worlds/1/')
	    .then(res => {
		this.state.preset = res.data.preset;
		console.log(res.data.preset);
	    }).catch(err => {
		console.log(err);
	    });
    }

    render() {
	console.log(this.state.world.state.preset)
	return (
	    <h1>working</h1>
	)
    }
}

export default App;
